$app.controller('UploadCtrl', ['$scope', '$routeParams', '$http', '$timeout', 'settingsService', function($scope, $routeParams, $http, $timeout, $settingsService) {
    $scope.source = $routeParams.source;
    $scope.servers = $settingsService.getConfigurations();
    $scope.server = $scope.servers[$settingsService.getDefaultConfiguration()];

    var send = function send() {
        console.log($scope.server);
        $scope.server = $scope.servers[$scope.server.id];
        var picture = {
            "content": $scope.image,
            "user": "Flo"
        };
        $http({
            method: "POST",
            url: $scope.server.server,
            data: picture})
            .then(function success() {
                $scope.message = {
                    text: "Image upload succeeded"
                };
            }, function error() {
                $scope.message = {
                    text: "Image upload failed",
                    isWarn: true
                };
            });
    };

    var retake = function retake(source) {
        $scope.source = source;
        takePicture();
    };

    $scope.send = send;
    $scope.retake = retake;

    function onCaptureSuccess(imageData) {
        $timeout(function() {
            $scope.image = "data:image/jpeg;base64," + imageData;
        });
    }

    function onFail(message) {
        $scope.message = {
            text: "Getting picture failed: " + (message.name ? message.name : "unknown error"),
            isWarn: true
        };
    }

    function takePicture() {
        $timeout(function() {

            if (navigator.camera) {
                if ($scope.source == 'capture') {
                    navigator.camera.getPicture(onCaptureSuccess, onFail, { quality: 50,
                        destinationType: Camera.DestinationType.DATA_URL,
                        sourceType: Camera.PictureSourceType.CAMERA
                    });
                } else if ($scope.source == 'gallery') {
                    navigator.camera.getPicture(onCaptureSuccess, onFail, { quality: 50,
                        destinationType: Camera.DestinationType.DATA_URL,
                        sourceType: Camera.PictureSourceType.PHOTOLIBRARY
                    });
                }
            } else {
                $scope.image = "data:image/jpeg;base64,";
            }
        });
    }

    if (navigator.camera) {
        takePicture();
    }
}]);